import React, { useEffect,useState } from 'react';

const CompletePayment = (props) => {
    <>
    <p>Name of Person : {props.name}</p>
    <p>Age of Person : {props.age}</p>
    <p>Batch : {props.selectedBatch}</p>
    <p>Amount Paid : {"500 Rs"}</p>
    </>
};
function App() {
    return (
      <div>
        <Welcome name="Sara" />
        <Welcome name="Cahal" />
        <Welcome name="Edite" />
      </div>
    );
  }

export default CompletePayment;
